import {
  SEARCH_FILTER,
} from '../actions'

const filterInitial = {
  filterByName:'',
}
const searchFilter = (state = filterInitial, action) => {
  if (action.type === SEARCH_FILTER) {
    return {
      ...state,
      filterByName: action.filterByName,
    }
  }
  return {
    state
  }
}
export default searchFilter;
